import logo from './logo.svg';
import './App.css';
import React from 'react';
// import Item from './MyItem';


class StarWards extends React.Component { 
  render() {
    return (
      <h1>This star wards</h1>
    )
  }
}


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        {/* <Item name="Teddy" />  */}

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
